INSERT INTO `tbl_character` (`id`, `v_character_text`, `v_character_description`, `v_image`, `v_job`, `status`, `is_deleted`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 'Electron Pioneer', 'As an electron pioneer you improve every element of everyday life. You could use your chemical engineering skills to design and manage processes that turn raw materials such as oil into everyday products such as smartphones. You could be solving problems on a chocolate production line, creating new technologies to combat air or water pollution, or developing new ways to beat cancer. Jobs include:', 'Chemical.png', '1,2,3', 1, 1, '2020-01-23 12:50:28', '2020-01-23 13:17:12', NULL),
(2, 'Electron Pioneer', 'As an electron pioneer you improve every element of everyday life. You could use your chemical engineering skills to design and manage processes that turn raw materials such as oil into everyday products such as smartphones. You could be solving problems on a chocolate production line, creating new technologies to combat air or water pollution, or developing new ways to beat cancer.', 'Square - Chemical.png', '1,3,2', 1, 0, '2020-01-23 13:01:12', '2020-04-17 14:32:28', NULL),
(3, 'Future Lifesaver', 'As a future lifesaver the world depends on you. You could use your biomedical engineering or medical physics expertise in a hospital, a lab or in industry, coming up with innovations that improve our health and quality of life. You could be developing medical devices such as MRI scanners, researching tissue for implants, designing prosthetic limbs, and using robots to perform operations remotely.', 'Square - Medical.png', '6,4,5', 1, 0, '2020-01-23 13:03:53', '2020-04-17 14:31:52', NULL),
(4, 'Mechanical Marvel', 'As a mechanical marvel you keep the world in motion. You could work in the field of mechanical or biomechanical engineering. Your work might involve anything from designing Formula 1 cars and building planes to creating artificial heart valves and developing prosthetic limbs. Every machine you can think of relies on the skills of a mechanical engineer.', 'Square - Mechanical.png', '9,8,7', 1, 0, '2020-01-23 13:22:57', '2020-04-17 14:31:24', NULL),
(5, 'Cure Creator', 'As a cure creator you\'re in the business of saving lives. You could work in the field of biochemical engineering, along with other types of engineers, solving problems that affect people, animals or plants. You could be researching and developing cancer treatments and vaccinations or making foods more nutritious.', 'Square - Biochemical.png', '70,35,11', 1, 0, '2020-01-23 13:24:48', '2020-04-17 14:30:59', NULL),
(6, 'Coding Legend', 'As a coding legend, you make your mark in the digital world! Software engineers and computer scientists are in demand in all sectors including industry, entertainment and retail. You could be working on artificial intelligence, human-computer interaction, computer graphics, robotics and information security.', 'Square - Computer Science.png', '14,59,58', 1, 0, '2020-01-23 13:36:11', '2020-04-17 14:30:29', NULL),
(7, 'Crime Preventer', 'As a crime preventer, you make the world a safer place. You could work in the fields of security and crime science to help protect us and keep us safe. You could be designing anti-theft devices, improving cyber security or finding the forensic evidence used in criminal trials.', 'Square - Security Crime.png', '41,40,39', 1, 0, '2020-01-23 13:51:48', '2020-04-17 10:22:23', NULL),
(8, 'Civilisation Saver', 'As a civilisation saver you create the cities of the future. You could use your civil and environmental engineering skills to keep us safe from flooding, design transport systems and construct hospitals, schools and sports arenas, while minimising the impact on our environment and tackling climate change.', 'Square - Civil.png', '44,19,43', 1, 0, '2020-01-24 05:48:03', '2020-04-17 14:29:25', NULL),
(9, 'Electric Dynamo', 'As an electric dynamo you light up the world. As an electrical or electronics engineer you could be designing the latest smartphone or robot, creating a state-of-the-art electric car, developing a GPS system or inventing a new way to generate power.', 'Square - Electrical.png', '45,60,24', 1, 0, '2020-01-24 06:19:03', '2020-04-17 14:28:50', NULL),
(10, 'Universe Explorer', 'As a universe explorer, the sky\'s not the limit! Your aerospace engineering skills could help you design the next generation of aircraft, reduce the pollution caused by air travel, build drones and put satellites in space. You might also work in the transport sector and Formula 1.', 'Square - Aerospace.png', '48,61,50', 1, 0, '2020-01-24 06:34:59', '2020-04-17 14:28:08', NULL),
(11, 'Sea Crusader', 'As a sea crusader, dive into an ocean of possibilities! You could use your marine engineering skills as part of a team that constructs off-shore platforms, explores the sea bed, designs ships and remotely operated underwater vehicles, or even plans lighthouses.', 'Square - Marine.png', '51,53,52', 1, 0, '2020-01-24 06:51:57', '2020-04-17 14:27:30', NULL),
(12, 'Materials Maker', 'As a material\'s maker you shape the products of the future. Working in manufacturing and materials engineering, you could use your skills to work out how to get the best out of all the materials available to us in the safest, greenest way possible, turning raw materials into finished products. You could work with cars, wind turbine blades, sports equipment, packaging and smartphones.', 'Square - Manufacturing Production.png', '54,55,56', 1, 0, '2020-01-24 06:56:07', '2020-04-17 14:26:35', NULL),
(14, 'Pi', 'Pi is a mathematical constant. Originally defined as the ratio of a circle\'s circumference to its diameter, it now has various equivalent definitions and appears in many formulas in all areas of mathematics and physics. It is approximately equal to 3.14159', 'Mathscot.jpg', '26,49,61,38,59,13,36,58', 0, 1, '2020-02-21 17:56:38', '2020-03-18 14:51:10', NULL),
(15, 'Allow One of System', 'Hello World !! Nice to meet you all.', 'A2Z_stick_figure_drawing_thank_you_800_clr.png', '58,50,19,52,56', 0, 1, '2020-02-24 12:04:51', '2020-03-18 14:49:52', NULL),
(16, 'Mett a test A12227755 today 26', 'Hola !! Hola !! Hola !!\r\n1234567890\r\nABCDEFGH\r\n55 today 2602', '10f01f9c-476b-4e03-b932-9f67825af7f7.png', '48,4', 0, 1, '2020-02-24 14:18:38', '2020-03-18 14:49:47', NULL),
