(20, 'Perseverance', 'The Mars 2020 rover, Perseverance, is based on the Mars Science Laboratory\'s Curiosity rover configuration. It is car-sized, about 10 feet long (not including the arm), 9 feet wide, and 7 feet tall (about 3 meters long, 2.7 meters wide, and 2.2 meters tall). But at 2,260 pounds (1,025 kilograms), it weighs less than a compact car. In some sense, the rover parts are similar to what any living creature would need to keep it \"alive\" and able to explore.', 'Annotation 2020-03-16 130847.jpg', '48,8,41,40', 1, 1, '2020-03-16 13:09:08', '2020-03-18 14:51:24', NULL),
