INSERT INTO `tbl_cms` (`id`, `v_title`, `v_sub_title`, `t_content`, `v_slug`, `i_order`, `status`, `v_image`, `v_image_row`, `is_deleted`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 'Meet the future you', 'Ever wondered what an engineer does?', '<p>Answer a few short questions and find out how YOUR skills and passions could lead to an exciting job in the future.</p>\r\n\r\n<p>Whether you&#39;re just starting out, or are ready to think about your next steps, this is the quiz for YOU.</p>\r\n\r\n<p>Take the quiz and get ready to be inspired&hellip;</p>', 'intro_page', 0, 1, '1585144621-TBB.png,1585144621-TE.png,1585144621-UCL.png', '', 0, '2019-02-04 19:46:26', '2020-04-16 08:35:03', NULL),
(2, 'Thank you for taking the quiz.', '', '<p>There are lots of different ways to become an engineer after you leave school. You could go to college, do an apprenticeship, go to university or combine different routes.&nbsp;</p>\r\n\r\n<p>Find out more about how to become an engineer and the different types of engineering at:<br />\r\n<a href=\"http://www.tomorrowsengineers.org.uk\" target=\"_blank\">www.tomorrowsengineers.org.uk</a></p>', 'final-page', 0, 1, '1585215800-TBB.png,1585215800-TE.png,1585215800-UCL.png', '1585144990-ICE.png,1585144990-IET.png,1585144990-IME.png,1585144990-IOP.png,1585144990-RAE.png', 0, '2019-02-04 19:46:26', '2020-04-03 15:53:31', NULL),
(3, 'Result Page', '', '<p>Congratulations! With these skills, you could have a great future in engineering. Engineers use their skills and knowledge to solve problems, making a difference to the world and improving how we live.</p>\r\n\r\n<p>There are lots of different ways to get into engineering after you leave school. You could go to college, do an apprenticeship, go to university or combine different routes.</p>', 'result-page', 0, 1, '', '', 0, '2019-02-04 21:14:49', '2020-04-16 10:03:49', NULL),
(4, 'Thank you for your feedback.', '', '<p><strong>Your answers will help us make the quiz even better in the future.</strong></p>', 'feedback-thankyou-page', 0, 1, '1585320873-TBB.png,1585320873-TE.png,1585320873-UCL.png', '1585320873-ICE.png,1585320873-IET.png,1585320873-IME.png,1585320873-IOP.png,1585320873-RAE.png', 0, '2019-02-04 19:46:26', '2020-03-31 13:38:34', NULL),
(5, 'Feedback', '', '<p><strong><em>We would love to hear your thoughts about the quiz you have just taken. Please spend 2 minutes answering the questions below.</em></strong></p>', 'feedback-page', 0, 1, '', '', 0, '2019-02-25 15:26:20', '2020-04-01 13:20:32', NULL),
(13, 'start quiz page test', '', '<p>Start quiz</p>', 'start_quiz_page', 0, 1, '1585144770-ICE.png,1585144770-IET.png,1585144770-IME.png,1585144770-IOP.png,1585144770-RAE.png', '', 0, '0000-00-00 00:00:00', '2020-04-16 11:33:05', NULL);
