INSERT INTO `tbl_job` (`id`, `v_job_text`, `v_job_description`, `status`, `is_deleted`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 'Chemical Engineer', 'Chemical engineers create processes and products which touch every aspect of our lives - from developing smaller, faster computer chips to innovating the way we recycle, treat disease, make food, clean water and generate power.', 1, 0, '2019-02-04 20:30:53', '2020-01-23 12:48:36', NULL),
(2, 'Process Engineer', 'Process engineers are chemical engineers who work on developing and improving manufacturing and industrial processes such as producing food, making paints or plastics, refining oil and treating water.', 1, 0, '2019-02-04 20:30:53', '2020-01-23 12:48:37', NULL),
(3, 'Cosmetic Scientist', 'Cosmetic scientists are in demand by many companies. They create new cosmetics like make-up, shampoo and sun-cream. They make formulas, test products, control quality and can specialise in areas such as organics.', 1, 0, '2019-02-04 20:30:53', '2020-01-20 12:58:01', NULL),
(4, 'Biomedical Engineer', 'Biomedical engineers combine engineering and materials technology to improve healthcare. They design medical products such as joint replacements, robotic surgical instruments and equipment to help people with special needs.', 1, 0, '2019-02-04 20:30:53', '2020-01-20 12:58:03', NULL),
(5, 'Medical Physicist', 'Medical physicists improve patients\' health. They could be working with doctors on the diagnosis and treatment of specific medical conditions, such as advising on radiation treatments for cancer patients.', 1, 0, '2019-02-04 20:30:53', '2020-04-24 17:03:41', NULL),
(6, '3D Organ Printing Technician', 'Much of the work of 3D organ printing technicians is still in the research and developmental phase, but rapid progress in the field means that printing artificial organs for patients will become extremely important in the future.', 1, 0, '2019-02-04 20:30:53', '2020-01-20 12:58:05', NULL),
(7, 'Mechanical Engineer', 'Mechanical engineers deal with anything that moves, finding practical solutions to problems. This huge field ranges from nuclear fusion and artificial hearts to building planes and designing driverless cars.', 1, 0, '2019-02-04 20:30:53', '2020-01-20 12:58:07', NULL),
(8, 'CAD Technician', 'CAD or computer-aided design technicians use software to create design plans for buildings, machinery and products. You could work in a wide range of industries from car manufacturing to designing sports equipment.', 1, 0, '2019-02-04 20:30:53', '2020-01-20 12:58:10', NULL),
(9, 'Biomechanical Engineer', 'Biomechanical engineers combine mechanical engineering with biology to create everyday products that improve peoples\' quality of life. This could include environmentally safe plastics, food, fabrics and medicines.', 1, 0, '2019-02-04 20:30:53', '2020-04-24 17:00:08', NULL),
(10, 'Biochemical Engineer', 'Biochemical engineers translate exciting discoveries in life sciences into materials and processes that improve human health and well-being. These include cleaner fuels, new medicines and healthier food and drink products.', 1, 1, '2019-02-04 20:30:53', '2020-01-24 13:50:24', NULL),
(11, 'Toxicologist', 'Toxicologists look at the impact of toxic materials and radiation on the environment and on human and animal health. They carry out laboratory and field studies and can work in many different areas including clinical, forensic, industrial and pharmaceutical.', 1, 0, '2019-02-04 20:30:53', '2020-01-23 13:24:11', NULL),
(12, 'Cancer Researcher', 'Cancer researchers, also known as oncology research scientists,  work to discover new and more effective ways to prevent and treat all kinds of cancer.', 0, 1, '2019-02-04 20:30:53', '2020-03-16 11:31:22', NULL),
(13, 'Software Engineer', 'Software engineers design, build and test computer programs. They talk to customers to understand their needs and then help to set up the systems to meet those needs. They also diagnose and resolve system faults.', 0, 1, '2019-02-04 20:30:53', '2020-03-16 11:32:47', NULL),
(14, 'Computer Scientist', 'Computer scientists develop different ways to use technology and design new products such as tablets, laptops and other electronic devices, including central heating controllers and smart TVs.', 1, 0, '2019-02-04 20:30:53', '2020-04-24 16:58:21', NULL),
(15, 'Games Designer', 'Often working in a team, games designers plan and create all the elements of a game including the setting, rules, story and characters. They use computer modelling and animation software and create the computer code needed to make the game work.', 0, 1, '2019-02-04 20:30:53', '2020-01-23 13:35:01', NULL),
(16, 'Intrusion Analyst', 'Working individually or as part of a team, intrusion analysts review data on physical break-ins or cyber attacks, identify vulnerabilties and interact with customers to tackle problems and improve physical and on-line security.', 0, 1, '2019-02-04 20:30:53', '2020-01-23 13:48:52', NULL),
(17, 'Forensic Scientist', 'Forensic scientists collect evidence at crime scenes to be used in legal trials. Biology helps solve crimes like murder and assault; chemistry is used for burglary and arson; and toxicology is used to detect drugs, alcohol or poisons.', 0, 1, '2019-02-04 20:30:53', '2020-01-23 13:49:23', NULL),
(18, 'Certified Ethical Hacker', 'A certified ethical hacker identifies weaknesses in systems, using the same knowledge and tools as a malicious hacker, but in a lawful and legitimate way.  They check the security of computer systems used in government, defence, banking and health records.', 0, 1, '2019-02-04 20:30:53', '2020-01-23 13:50:04', NULL),
(19, 'Structural Engineer', 'Structural engineers design and create safe buildings and large structures such as roads, bridges, tunnels, railways, shopping centres and airports. They also protect us from flooding and help supply us with energy.', 1, 0, '2019-02-04 20:30:53', '2020-01-24 05:21:43', NULL),
(20, 'Wind Turbine Technician', 'Wind turbine technicians keep wind turbines working properly. They carry out routine inspections of wind farms, troubleshoot problems and repair wind turbines. These skills are in demand in this growing field.', 0, 1, '2019-02-04 20:30:53', '2020-01-24 05:21:53', NULL),
(21, 'Flood Modeller', 'Flood risk modellers predict flooding, produce flood maps and find ways to reduce the effects of rainfall, river and sea flooding. They might work for the Environment Agency, local authorities or private sector clients.', 0, 1, '2019-02-04 20:30:53', '2020-01-24 05:22:05', NULL),
(22, 'Electrical Engineering Technician', 'Electrical engineering technicians test, repair and help to design electrical equipment such as railway signals, lifts, heating and air-conditioning systems and hospital machinery.', 0, 1, '2019-02-04 20:30:53', '2020-01-24 06:02:30', NULL),
(23, 'Electronics Engineer', 'Electrical engineering technicians test, repair and help to design electrical equipment such as railway signals, lifts, heating and air-conditioning systems and hospital machinery.', 1, 1, '2019-02-04 20:30:53', '2020-01-24 05:57:12', NULL),
(24, 'Robotics Engineer', 'Robotics engineers design plans for robots and work with other types of engineers to design and put them together. This might include robots for car production lines, an animatronic dinosaur for an amusement park, or a robot to travel into space or beneath the sea.', 1, 0, '2019-02-04 20:30:53', '2020-01-23 10:29:07', NULL),
(25, 'Aerospace Engineer', 'Aerospace engineers design, develop and test the performance of civil and military aircraft, drones, satellites, space vehicles and their components. They help to improve safety, efficiency and environmental impact.', 0, 1, '2019-02-04 20:30:53', '2020-01-24 06:19:21', NULL),
(26, 'Flight Simulation Technician', 'Flight simulator technicians maintain and repair flight simulators which artificially re-create aircraft flight in order to train pilots and inform the design of aircraft.', 0, 1, '2019-02-04 20:30:53', '2020-03-16 11:31:10', NULL),
(27, 'Space Structures Engineer', 'Space structures engineers design equipment for the space industry, such as launch pads, shuttles and space stations. They have a key role in ensuring the safety of equipment and crews. For example, they might look at the effects of solar storms on the international space station.', 0, 1, '2019-02-04 20:30:53', '2020-01-24 06:20:00', NULL),
(28, 'Marine Engineer', 'Marine engineers use their technical skills and knowledge to design, build, install and maintain the propulsion systems, steering, engines and other equipment that make boats work. They might work on ships, cruise liners, hovercraft and submarines.', 0, 1, '2019-02-04 20:30:53', '2020-01-24 06:35:47', NULL),
(29, 'Subsea Engineer', 'Subsea engineers work on underwater projects such as  ocean exploration, remote- controlled underwater vehicles, submarine communications, seafloor mineral mining, oil and gas pipelines and offshore wind power.', 0, 1, '2019-02-04 20:30:53', '2020-01-24 06:36:02', NULL),
(30, 'Naval Architect', 'Naval architects are responsible for ship design. They manage the whole process, from the concept through to the delivery. They manage teams of engineers and work on all types of  vessel, from rescue boats to yachts.', 0, 1, '2019-02-04 20:30:53', '2020-01-24 06:36:13', NULL),
(31, 'Materials Engineer', 'Materials engineers explore ways to combine materials to make products stronger, lighter, more effective or more hard-wearing, from computer chips and aircraft wings to tennis rackets and biomedical devices.', 0, 1, '2019-02-04 20:30:53', '2020-01-24 06:54:42', NULL),
(32, 'Product Engineer', 'Product engineers are responsible for bringing new products to market, managing all stages of the process from design through to final production. This includes  looking at cost, look and feel, functionality and performance.', 0, 1, '2019-02-04 20:30:53', '2020-01-24 06:54:53', NULL),
(33, 'Sustainability Manager', 'Sustainability managers help companies take steps towards a greener future, implementing cost-effective measures to protect the environment and meet the needs of present and future generations.', 0, 1, '2019-02-04 20:30:53', '2020-01-24 06:55:03', NULL),
(34, 'Toxicologist', 'Toxicologists look at the impact of toxic materials and radiation on the environment and on human and animal health. They carry out laboratory and field studies and can work in many different areas including clinical, forensic, industrial and pharmaceutical.', 0, 1, '2020-01-07 12:13:08', '2020-01-23 13:24:07', NULL),
(35, 'Cancer Researcher', 'Cancer researchers, also known as oncology research scientists,  work to discover new and more effective ways to prevent and treat all kinds of cancer.', 1, 0, '2020-01-07 12:13:24', '2020-03-16 11:33:43', NULL),
(36, 'Software Engineer', 'Software engineers design, build and test computer programs. They talk to customers to understand their needs and then help to set up the systems to meet those needs. They also diagnose and resolve system faults.', 0, 1, '2020-01-07 12:13:45', '2020-03-16 11:34:04', NULL),
(37, 'Computer Scientist', 'Computer scientists develop different ways to use technology and design new products such as tablets, laptops and other electronic devices, including central heating controllers and smart TVs .', 0, 1, '2020-01-07 12:14:09', '2020-01-23 13:34:46', NULL),
(38, 'Games Designer', 'Often working in a team, games designers plan and create all the elements of a game including the setting, rules, story and characters. They use computer modelling and animation software and create the computer code needed to make the game work.', 1, 1, '2020-01-07 12:14:36', '2020-03-16 11:32:39', NULL),
(39, 'Intrusion Analyst', 'Working individually or as part of a team, intrusion analysts review data on physical break-ins or cyber-attacks, identify vulnerabilities and interact with customers to tackle problems and improve physical and on-line security.', 1, 0, '2020-01-07 12:15:01', '2020-04-24 16:55:23', NULL),
(40, 'Forensic Scientist', 'Forensic scientists collect evidence at crime scenes to be used in legal trials. Biology helps solve crimes like murder and assault; chemistry is used for burglary and arson; and toxicology is used to detect drugs, alcohol or poisons.', 1, 0, '2020-01-07 12:15:20', '2020-01-23 13:49:17', NULL),
(41, 'Certified Ethical Hacker', 'Acertified ethical hackeridentifies weaknesses in systems, using the same knowledge and tools as a malicioushacker, but in a lawful and legitimate way.  They check the security of computer systems used in government, defence, banking and health records.', 1, 0, '2020-01-07 12:15:48', '2020-04-24 16:53:22', NULL),
(42, 'Structural Engineer', 'Structural engineers design and create safe buildings and large structures such as roads, bridges, tunnels, railways, shopping centres and airports. They also protect us from flooding and help supply us with energy.', 0, 1, '2020-01-07 12:16:11', '2020-01-24 05:21:37', NULL),
(43, 'Wind Turbine Technician', 'Wind turbine technicians keep wind turbines working properly. They carry out routine inspections of wind farms, troubleshoot problems and repair wind turbines. These skills are in demand in this growing field.', 1, 0, '2020-01-07 12:16:29', '2020-01-24 05:21:50', NULL),
(44, 'Flood Modeller', 'Flood risk modellers predict flooding, produce flood maps and find ways to reduce the effects of rainfall, river and sea flooding. They might work for the Environment Agency, local authorities or private sector clients.', 1, 0, '2020-01-07 12:16:46', '2020-01-24 05:22:03', NULL),
(45, 'Electrical Engineering Technician', 'Electrical engineering technicians test, repair and help to design electrical equipment such as railway signals, lifts, heating and air-conditioning systems and hospital machinery.', 1, 0, '2020-01-07 12:17:03', '2020-01-24 05:50:35', NULL),
(46, 'Electronics Engineer', 'Electronics engineers design and develop electronic equipment including computers, TVs, LED lighting, medical equipment and the gadgets of the future.', 0, 1, '2020-01-07 12:17:20', '2020-01-24 05:49:41', NULL),
(47, 'Robotics Engineer', 'Robotics engineers design plans for robots and work with other types of engineers to design and put them together. This might include robots for car production lines, an animatronic dinosaur for an amusement park, or a robot to travel into space or beneath the sea.', 0, 1, '2020-01-07 12:17:37', '2020-01-24 05:49:53', NULL),
(48, 'Aerospace Engineer', 'Aerospace engineers design, develop and test the performance of civil and military aircraft, drones, satellites, space vehicles and their components. They help to improve safety, efficiency and environmental impact.', 1, 0, '2020-01-07 12:17:52', '2020-01-24 06:19:19', NULL),
(49, 'Flight Simulation Technician', 'Flight simulator technicians maintain and repair flight simulators which artificially re-create aircraft flight in order to train pilots and inform the design of aircraft.', 0, 1, '2020-01-07 12:18:11', '2020-03-16 11:31:56', NULL),
(50, 'Space Structures Engineer', 'Space structures engineers design equipment for the space industry, such as launch pads, shuttles and space stations. They have a key role in ensuring the safety of equipment and crews. For example, they might look at the effects of solar storms on the International Space Station.', 1, 0, '2020-01-07 12:18:35', '2020-01-24 06:19:58', NULL),
(51, 'Marine Engineer', 'Marine engineers use their technical skills and knowledge to design, build, install and maintain the propulsion systems, steering, engines and other equipment that make boats work. They might work on ships, cruise liners, hovercraft and submarines.', 1, 0, '2020-01-07 12:18:53', '2020-01-23 10:29:03', NULL),
(52, 'Subsea Engineer', 'Subsea engineers work on underwater projects such as ocean exploration, remote-controlled underwater vehicles, submarine communications, seafloor mineral mining, oil and gas pipelines and offshore wind power.', 1, 0, '2020-01-07 12:19:13', '2020-04-24 16:48:09', NULL),
(53, 'Naval Architect', 'Naval architects are responsible for ship design. They manage the whole process, from the concept through to the delivery. They manage teams of engineers and work on all types of vessels, from rescue boats to yachts.', 1, 0, '2020-01-07 12:19:30', '2020-04-24 16:47:08', NULL),
(54, 'Materials Engineer', 'Materials engineers explore ways to combine materials to make products stronger, lighter, more effective or more hard-wearing, from computer chips and aircraft wings to tennis rackets and biomedical devices.', 1, 0, '2020-01-07 12:19:53', '2020-03-27 14:37:02', NULL),
(55, 'Product Engineer', 'Product engineers are responsible for bringing new products to market, managing all stages of the process from design through to final production. This includes  looking at cost, look and feel, functionality and performance.', 1, 0, '2020-01-07 12:20:11', '2020-01-23 10:29:01', NULL),
(56, 'Sustainability Manager', 'Sustainability managers help companies take steps towards a greener future, implementing cost-effective measures to protect the environment and meet the needs of present and future generations.', 1, 0, '2020-01-07 12:20:28', '2020-01-24 06:55:00', NULL),
(58, 'Software Engineer', 'Software engineers design, build and test computer programs. They talk to customers to understand their needs and then help to set up the systems to meet those needs. They also diagnose and resolve system faults.', 1, 0, '2020-01-23 13:35:28', '2020-04-24 16:43:26', NULL),
